def _image_from_b64(b64_string, w_px, h_px):
    """
    Construit une Image openpyxl à partir d'une chaîne base64 (PNG/JPEG).
    Accepte soit le base64 seul, soit un data URI (data:image/...;base64,...).
    Retourne None si chaîne vide ou erreur.
    """
    if not b64_string or not b64_string.strip():
        return None
    try:
        s = b64_string.strip()
        if s.startswith("data:") and "," in s:
            s = s.split(",", 1)[1]  # garder uniquement la partie base64
        raw = base64.b64decode(s)
        buf = io.BytesIO(raw)
        buf.seek(0)
        img = XLImage(buf)
        img.width, img.height = w_px, h_px
        return img
    except Exception:
        return None


def _accueil_image(ws, path, anchor, w_px, h_px):
    """Insère une image dans ws à l'ancre donnée depuis un fichier. Ignore si absent."""
    if not path or not os.path.isfile(path):
        return
    try:
        img = XLImage(path)
        img.width, img.height = w_px, h_px
        ws.add_image(img, anchor)
    except Exception:
        pass


def _accueil_image_insert(ws, anchor, w_px, h_px, b64_string=None, path=None):
    """Insère une image à l'ancre : priorité base64 si fourni et non vide, sinon fichier."""
    img = None
    if b64_string and b64_string.strip():
        img = _image_from_b64(b64_string, w_px, h_px)
    if img is None and path and os.path.isfile(path):
        try:
            img = XLImage(path)
            img.width, img.height = w_px, h_px
        except Exception:
            img = None
    if img is not None:
        ws.add_image(img, anchor)


def fill_onglet_accueil(ws, site, script_folder):
    """
    Remplit l'onglet Accueil (position 0) avec une page de garde de rapport
    de pré-commissioning : titres, images, tableau description, bloc texte, légendes.
    Les images sont cherchées dans script_folder (même dossier que le script).
    """
    b = bdr()
    thin = Side(style="thin", color="CCCCCC")
    dark_title_fill = PatternFill("solid", start_color=ACCUEIL_TITRE_DARK)
    gray_fill = PatternFill("solid", start_color=ACCUEIL_GRAY_HEADER)
    lc = get_column_letter(ACCUEIL_NCOLS)

    # Largeurs de colonnes (titre B2:K2 ; G/H larges pour Description + données à venir ; I–K textes longs)
    for c in range(1, ACCUEIL_NCOLS + 1):
        letter = get_column_letter(c)
        if c in (7, 8):  # G, H : bien espacées pour labels + données (photos)
            ws.column_dimensions[letter].width = 28
        elif c == 1:
            ws.column_dimensions[letter].width = 24
        elif 9 <= c <= ACCUEIL_PDG_COLS_BK:  # I, J, K : largeur pour absorber les textes longs
            ws.column_dimensions[letter].width = 22
        elif 2 <= c <= 6:
            ws.column_dimensions[letter].width = 18
        else:
            ws.column_dimensions[letter].width = 10

    # ----- 1) Titre principal — fusion B2:K2 (aligné sur les autres blocs, ne dépasse pas en N) -----
    row_titre = 2
    ws.row_dimensions[row_titre].height = pixels_to_points(ACCUEIL_TITRE_H_PX)
    ws.merge_cells(f"B{row_titre}:K{row_titre}")
    c_titre = ws[f"B{row_titre}"]
    c_titre.value = f"Rapport de pré-commissioning de {site}"
    c_titre.font = Font(name="Calibri", bold=True, size=22, color="FFFFFF")
    c_titre.fill = dark_title_fill
    c_titre.alignment = Alignment(horizontal="center", vertical="center", wrap_text=True)

    # ----- 2) Photo centrale (vue aérienne) — Ancre B10, grande taille pour visibilité -----
    row_logo_centrale = 10
    ws.row_dimensions[row_logo_centrale].height = pixels_to_points(325)
    vue_path = os.path.join(script_folder, "vue aerienne centrale solaire.png")
    _accueil_image_insert(ws, f"B{row_logo_centrale}", 537, 432, B64_VUE, vue_path)

    # ----- 3) Logo Omexom — Ancre G11, 567px × 156px -----
    row_logo_omexom = 13
    ws.row_dimensions[row_logo_omexom].height = pixels_to_points(ACCUEIL_LOGO_OMEXOM_H_PX)
    logo_path = os.path.join(script_folder, "logoomexom.png")
    _accueil_image_insert(ws, f"G{row_logo_omexom}", ACCUEIL_LOGO_OMEXOM_W_PX, ACCUEIL_LOGO_OMEXOM_H_PX, B64_LOGO, logo_path)

    # ----- 4) Bloc "Inspection du site" — même style que "Description du site..." (fond 1F3864, blanc, bold 12, centré), pas de forme séparée -----
    thick = Side(style="thick", color="000000")
    row_bloc = 24
    ws.row_dimensions[row_bloc].height = pixels_to_points(ACCUEIL_BLOC_BLEU_H_PX)
    ws.merge_cells(f"B{row_bloc}:{get_column_letter(ACCUEIL_PDG_COLS_BJ)}{row_bloc}")
    cell_rapport = ws.cell(row=row_bloc, column=2)
    cell_rapport.value = f"Inspection du site de {site} avant mise en service et réception en O&M"
    cell_rapport.font = Font(name="Calibri", bold=True, size=16, color="FFFFFF")
    cell_rapport.fill = dark_title_fill
    cell_rapport.alignment = Alignment(horizontal="center", vertical="center", wrap_text=True)

    # ----- Fond blanc : à partir de la ligne 25 -----
    white_fill = PatternFill("solid", start_color="FFFFFF")
    lc_j = get_column_letter(ACCUEIL_PDG_COLS_BJ)  # J — conformité blueprint (blocs B à J)
    lc_k = get_column_letter(ACCUEIL_PDG_COLS_BK)
    for row in range(25, 55):
        for col in range(1, ACCUEIL_NCOLS + 1):
            ws.cell(row=row, column=col).fill = white_fill

    fill_label = PatternFill("solid", start_color=ACCUEIL_FILL_LABEL_DESC)
    fill_donnee = PatternFill("solid", start_color=ACCUEIL_FILL_DONNEE_DESC)
    fill_badge_statut = PatternFill("solid", start_color=ACCUEIL_FILL_BADGE_STATUT)

    # ----- 6) Bloc Description (conformité blueprint) : B:C label, D:E donnée | G:H label, I:J donnée -----
    row_desc_title = 26
    ws.row_dimensions[row_desc_title].height = 22
    ws.merge_cells(f"B{row_desc_title}:{lc_j}{row_desc_title}")
    tit_desc = ws.cell(row=row_desc_title, column=2, value="Description du site en quelques chiffres")
    tit_desc.font = Font(name="Calibri", bold=True, size=12, color="FFFFFF")
    tit_desc.fill = dark_title_fill
    tit_desc.alignment = Alignment(horizontal="center", vertical="center")
    tit_desc.border = b
    left_labels = (
        "Client",
        "Numéro d'Affaires :",
        "Puissance totale de la centrale",
        "Date :",
        "Nombre de PDL / PTR",
        "Nombre de PTR",
    )
    right_labels = (
        "Type Onduleur : Cent/Décentralisé",
        "Nombre d' Onduleur",
        "Type Câblage solaire",
        "Type de raccordement solaire",
        "Type de Cheminement : Tranchée/CDC",
        "Type Tranchée : Gaines TPC / Enterrabilité directe ",
    )
    n_form_rows = max(len(left_labels), len(right_labels))
    for i in range(n_form_rows):
        r = row_desc_title + 1 + i
        ws.row_dimensions[r].height = 18
        # Gauche : B:C label (bleu clair D9E1F2), D:E donnée (blanc) — comme l'ancien manuel
        if i < len(left_labels):
            ws.merge_cells(f"B{r}:C{r}")
            cl = ws.cell(row=r, column=2, value=left_labels[i])
            cl.font = Font(name="Calibri", bold=True, size=12)
            cl.fill = fill_label
            cl.alignment = Alignment(horizontal="center", vertical="center")
            cl.border = b
        ws.merge_cells(f"D{r}:E{r}")
        for col in range(4, 6):
            ws.cell(row=r, column=col).fill = fill_donnee
            ws.cell(row=r, column=col).border = b
            ws.cell(row=r, column=col).alignment = Alignment(horizontal="center", vertical="center")
        # Droite : G:H label (F2E1D9), I:J donnée (D9D9D9)
        if i < len(right_labels):
            ws.merge_cells(f"G{r}:H{r}")
            cr = ws.cell(row=r, column=7, value=right_labels[i])
            cr.font = Font(name="Calibri", bold=True, size=12)
            cr.fill = fill_label
            cr.alignment = Alignment(horizontal="center", vertical="center")
            cr.border = b
        ws.merge_cells(f"I{r}:J{r}")
        for col in range(9, 11):
            ws.cell(row=r, column=col).fill = fill_donnee
            ws.cell(row=r, column=col).border = b
            ws.cell(row=r, column=col).alignment = Alignment(horizontal="center", vertical="center", wrap_text=True)

    # ----- 2) Texte d'introduction — fusion B–J sur 7 lignes, hauteur 21 pt, bordure noire fine -----
